int map[MAP_SIZE][MAP_SIZE];
int doors[4];  // 0 = top, 1 = left, 2 = bottom, 3 = right

int isPlayerHit;  // Used for player collision detection with enemy bullets, will be modified later
int playerHealth;
		  // later: add health and a game over condition
int gameState;
int numActiveEnemies;
int keyPressed;

typedef struct entity {
    double x;
    double y;
    double velo_x;
    double velo_y;
	int health; 				// only used by enemies
    int isActive;
} Entity;

typedef struct room {
    int exists;
    bool isClear;
	int isBoss;
} room;

room rooms[MAP_SIZE][MAP_SIZE];
Entity enemyBullets[NUM_BULLETS];
Entity playerBullets[NUM_BULLETS];
Entity enemies[NUM_ENEMIES];

void init_globals() {
	
	curRoom[0] =  MAP_SIZE / 2;
	curRoom[1] =  MAP_SIZE / 2;
	
	rooms[curRoom[0]][curRoom[1]].isClear = 1;
	
	init_map();
	
	rooms[curRoom[0]][curRoom[1]].isClear = 1;
	
	resetRoom();
	
	init_bullets();
	
for (int i= 0; i < NUM_ENEMIES; i++) {
	enemies[i].isActive = 0;
}

	rooms[curRoom[0]][curRoom[1]].isClear = 1;
	numActiveEnemies = 0;
	
	playerX = X_BOUND / 2;
	playerY = Y_BOUND / 2;
    
	curBullet = 0;
    player_curBullet = 0;
    frameCounter_enemy = 0;
    frameCounter_player = 0;
    isPlayerHit = 0;
	playerHealth = PLAYER_HEALTH;
	gameState = STATE_MENU;
	keyPressed = 0;
	
	

    player_aim_h = player_aim_v = 0;
}

void resetRoom() {
    if (rooms[curRoom[0]][curRoom[1]].isClear == false) {
	init_bullets();
	
	if(rooms[curRoom[0]][curRoom[1]].isBoss){
		numActiveEnemies = 1;
	}else{
		numActiveEnemies = NUM_ENEMIES;
	}
	
	init_enemies();
    }
    curBullet = 0;
    player_curBullet = 0;
    frameCounter_enemy = 0;
    frameCounter_player = 0;
    isPlayerHit = 0;

    player_aim_h = player_aim_v = 0;
}

void updateLED(){
	switch(playerHealth){
		case 0:
			led = 0b0;
			break;
		case 1:
			led = 0b1;
			break;
		case 2:
			led = 0b11;
			break;
		case 3:
			led = 0b111;
			break;
		case 4:
			led = 0b1111;
			break;
		case 5:
			led = 0b11111;
			break;
		case 6:
			led = 0b111111;
			break;
		case 7:
			led = 0b1111111;
			break;
		case 8:
			led = 0b11111111;
			break;
		case 9:
			led = 0b111111111;
			break;
		case 10:
			led = 0b1111111111;
			break;
		default:
			led = 0b0101010101;
	}
	
	*LED_BASE = led;
}

void updateDoors() {
    if (curRoom[1] != 0 && map[curRoom[0]][curRoom[1] - 1] >= 1) {
	doors[0] = map[curRoom[0]][curRoom[1] - 1];
    } else {
	doors[0] = 0;
    }
    if (curRoom[0] != 0 && map[curRoom[0] - 1][curRoom[1]] >= 1) {
	doors[1] = map[curRoom[0] - 1][curRoom[1]];
    } else {
	doors[1] = 0;
    }
    if (curRoom[1] != MAP_SIZE - 1 && map[curRoom[0]][curRoom[1] + 1] >= 1) {
	doors[2] = map[curRoom[0]][curRoom[1] + 1];
    } else {
	doors[2] = 0;
    }
    if (curRoom[0] != MAP_SIZE - 1 && map[curRoom[0] + 1][curRoom[1]] >= 1) {
	doors[3] = map[curRoom[0] + 1][curRoom[1]];
    } else {
	doors[3] = 0;
    }
}

int main(void) {
	seed = *SW_BASE;
	srand(seed);
    init_globals();

    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;

    *(pixel_ctrl_ptr + 1) = 0x200000;  // init back buffer to something else to enable double buffering
    back_buffer = *(pixel_ctrl_ptr + 1);

    while (1) {
	update();
	draw();
	waitForVsync();
	back_buffer = *(pixel_ctrl_ptr + 1);
    }
	draw();
	waitForVsync();
	back_buffer = *(pixel_ctrl_ptr + 1);
}

void init_map() {
    generateMap(map);
    for (int i = 0; i < MAP_SIZE; i++) {
	for (int j = 0; j < MAP_SIZE; j++) {
		if(map[i][j] == 1){
			rooms[i][j].exists = 1;
			rooms[i][j].isClear = false;
			rooms[i][j].isBoss = false;
		}
		else{
			if(map[i][j] == 2){
				rooms[i][j].exists = 1;
				rooms[i][j].isBoss = 1;
				rooms[i][j].isClear = false;
			}else{
				rooms[i][j].exists = 0;
				rooms[i][j].isClear = true;
				rooms[i][j].isBoss = false;
			}
		}
	    
	}
    }
    rooms[MAP_SIZE / 2][MAP_SIZE / 2].isClear = true;
}

void init_bullets() {
    for (int i = 0; i < NUM_BULLETS; i++) {
	reset_bullet(i);
	player_reset_bullet(i);
    }
}

void init_enemies() {
	
	if(!rooms[curRoom[0]][curRoom[1]].isBoss){
		for (int i = 0; i < NUM_ENEMIES; i++) {
		enemies[i].x = rand() % (X_BOUND - (4 * ENEMY_WIDTH) - (2 * WALL_WIDTH));  // Initialize positions to be a random point between the screen bounds
		enemies[i].x += (2 * WALL_WIDTH);					   // Adding this since you can still get 0 as an x val with just modulo
		enemies[i].y = rand() % (Y_BOUND - (4 * ENEMY_WIDTH) - (2 * WALL_WIDTH));
		enemies[i].y += (2 * WALL_WIDTH);
		enemies[i].velo_x = 0;
		enemies[i].velo_y = 0;
		enemies[i].isActive = 1;
		enemies[i].health = ENEMY_HEALTH;
		}
    }else{
		enemies[0].x = 144;
		enemies[0].y = 104;
		enemies[0].velo_x = 0;
		enemies[0].velo_y = 0;
		enemies[0].isActive = 1;
		enemies[0].health = 10;
	}
	
	
    
}

void reset_bullet(int i) {
    enemyBullets[i].x = 100;
    enemyBullets[i].y = 100;
    enemyBullets[i].velo_x = 0;
    enemyBullets[i].velo_y = 0;
    enemyBullets[i].isActive = 0;
}

void player_reset_bullet(int i) {
    playerBullets[i].x = 0;
    playerBullets[i].y = 0;
    playerBullets[i].velo_x = 0;
    playerBullets[i].velo_y = 0;
    playerBullets[i].isActive = 0;
}

void handle_input() {
    unsigned char byte1 = 0;
    unsigned char byte2 = 0;
    unsigned char byte3 = 0;

    volatile int *PS2_ptr = (int *)0xFF200100;	// PS/2 port address

    int PS2_data, RVALID;

    PS2_data = *(PS2_ptr);	   // read the Data register in the PS/2 port
    RVALID = (PS2_data & 0x8000);  // extract the RVALID field
    if (RVALID != 0) {
	/* always save the last three bytes received */
	byte1 = byte2;
	byte2 = byte3;
	byte3 = PS2_data & 0xFF;  // byte3 is the data bit - either key scan code or release
    }


	int gameOverPressed = 0;


    /*
	to handle holding down multiple keys, only consider it stopped if the key is released
    */
    switch (byte3) {
	// ========================================== Player movement ==========================================
	case 0x1D:  // W key
	    if (F0_FLAG) {
		F0_FLAG = 0;
		// Do not set to 0 if the opposite direction was pressed right after
		if (player_velo_y != 1 * PLAYER_VELO) {
		    player_velo_y = 0;
		}
	    } else {
		player_velo_y = -1 * PLAYER_VELO;
	    }
		keyPressed = 1;
	    break;
	case 0x1C:  // A key
	    if (F0_FLAG) {
		F0_FLAG = 0;
		if (player_velo_x != 1 * PLAYER_VELO) {
		    player_velo_x = 0;
		}
	    } else {
		player_velo_x = -1 * PLAYER_VELO;
	    }
		keyPressed = 1;
	    break;
	case 0x1B:  // S key
	    if (F0_FLAG) {
		F0_FLAG = 0;
		if (player_velo_y != -1 * PLAYER_VELO) {
		    player_velo_y = 0;
		}
	    } else {
		player_velo_y = PLAYER_VELO;
	    }
		keyPressed = 1;
	    break;
	case 0x23:  // D key
	    if (F0_FLAG) {
		F0_FLAG = 0;
		if (player_velo_x != -1 * PLAYER_VELO) {
		    player_velo_x = 0;
		}
	    } else {
		player_velo_x = PLAYER_VELO;
	    }
		keyPressed = 1;
	    break;
	case 0x2D:
		if (F0_FLAG) {
			F0_FLAG = 0;
		}
		else {
			gameOverPressed = 1;
		}
	break;

	    // ==================================================== Arrow keys ====================================================

	case 0x75:  // Up arrow
	    if (F0_FLAG) {
		// Arrow key released
		F0_FLAG = 0;
		E0_FLAG = 0;  // E0 flag will be up when key release, so need to disable it
		if (player_aim_v != 1) {
		    player_aim_v = 0;
		}
	    } else if (E0_FLAG) {
		// Arrow key pressed
		E0_FLAG = 0;
		player_aim_v = -1;
		isPlayerHit = 0;  // ********************************************************** Remove this line later, this is just for testing collisions **********************************************************
	    }
		keyPressed = 1;
	    break;
	case 0x6B:  // Left arrow
	    if (F0_FLAG) {
		// Arrow key released
		F0_FLAG = 0;
		E0_FLAG = 0;
		if (player_aim_h != 1) {
		    player_aim_h = 0;
		}
	    } else if (E0_FLAG) {
		// Arrow key pressed
		E0_FLAG = 0;
		player_aim_h = -1;
	    }
		keyPressed = 1;
	    break;
	case 0x72:  // Down arrow
	    if (F0_FLAG) {
		// Arrow key released
		F0_FLAG = 0;
		E0_FLAG = 0;
		if (player_aim_v != -1) {
		    player_aim_v = 0;
		}
	    } else if (E0_FLAG) {
		// Arrow key pressed
		E0_FLAG = 0;
		player_aim_v = 1;
	    }
keyPressed = 1;
	    break;
	case 0x74:  // Right arrow
	    if (F0_FLAG) {
		// Arrow key released
		F0_FLAG = 0;
		E0_FLAG = 0;
		if (player_aim_h != -1) {
		    player_aim_h = 0;
		}
	    } else if (E0_FLAG) {
		// Arrow key pressed
		E0_FLAG = 0;
		player_aim_h = 1;
	    }
keyPressed = 1;
	    break;

	    // =============================================== Special bytes ===============================================

	case 0xF0:
	    F0_FLAG = 1;
	    break;
	case 0xE0:
	    E0_FLAG = 1;
	    break;

	default:
	    break;
    }
	
	if (keyPressed) {
		if (gameState == STATE_MENU) gameState = STATE_PLAYING;
		
		keyPressed = 0;
	}
	else if (gameOverPressed) {
		if (gameState == STATE_GAMEOVER) {
			init_globals();
		}
		if (gameState == STATE_WIN) {
			init_globals();
		}
	}
}

void updateRoom(){
	if(numActiveEnemies <= 0){
		rooms[curRoom[0]][curRoom[1]].isClear = true;
		playerHealth = PLAYER_HEALTH;
		if(rooms[curRoom[0]][curRoom[1]].isBoss){
			gameState = STATE_WIN;
		}
	}
}

void update_player() {
    // Update player position - only update if they are not at an edge
    // later: do bound check with all terrain elements
    playerX += player_velo_x;
    playerY += player_velo_y;

    if (playerX <= (2 * WALL_WIDTH)) {
	if (numActiveEnemies != 0 || map[curRoom[0] - 1][curRoom[1]] == 0) {
	    playerX = (2 * WALL_WIDTH);
	} else {
	    if (playerY >= ((Y_BOUND + 1) / 2) - 2 * DOOR_WIDTH && playerY <= ((Y_BOUND + 1) / 2) + 2 * DOOR_WIDTH) {
		double tempPlayerY = playerY;
		
		updateRoom();
		curRoom[0] -= 1;

		// reinitialize the room
		resetRoom();

		playerX = X_BOUND - (2 * WALL_WIDTH) - (2 * PLAYER_WIDTH);
		playerY = tempPlayerY;
	    } else {
		playerX = (2 * WALL_WIDTH);
	    }
	}
    } else if (playerX + (2 * PLAYER_WIDTH - 1) >= X_BOUND - (2 * WALL_WIDTH)) {
	if (numActiveEnemies != 0 || map[curRoom[0] + 1][curRoom[1]] == 0) {
	    playerX = X_BOUND - (2 * WALL_WIDTH) - (2 * PLAYER_WIDTH - 1);
	} else {
	    if (playerY >= ((Y_BOUND + 1) / 2) - 2 * DOOR_WIDTH && playerY <= ((Y_BOUND + 1) / 2) + 2 * DOOR_WIDTH) {
		double tempPlayerY = playerY;
		
		updateRoom();
		curRoom[0] += 1;

		// reinitialize the room
		resetRoom();


		// Relocate player to other side of room
		playerX = (2 * PLAYER_WIDTH);
		playerY = tempPlayerY;
	    } else {
		playerX = X_BOUND - (2 * WALL_WIDTH) - (2 * PLAYER_WIDTH - 1);
	    }
	}
    }

    if (playerY <= (2 * WALL_WIDTH)) {
	if (numActiveEnemies != 0 || map[curRoom[0]][curRoom[1] - 1] == 0) {
	    playerY = (2 * WALL_WIDTH);
	} else {
	    if (playerX >= ((X_BOUND + 1) / 2) - 2 * DOOR_WIDTH && playerX <= ((X_BOUND + 1) / 2) + 2 * DOOR_WIDTH) {
		double tempPlayerX = playerX;
		
		updateRoom();
		curRoom[1] -= 1;

		// reinitialize the room
		resetRoom();

		playerY = Y_BOUND - (2 * WALL_WIDTH) - (2 * PLAYER_WIDTH);
		playerX = tempPlayerX;
	    } else {
		playerY = (2 * WALL_WIDTH);
	    }
	}
    } else if (playerY + (2 * PLAYER_WIDTH - 1) >= Y_BOUND - (2 * WALL_WIDTH)) {
	if (numActiveEnemies != 0 || map[curRoom[0]][curRoom[1] + 1] == 0) {
	    playerY = Y_BOUND - (2 * WALL_WIDTH) - (2 * PLAYER_WIDTH - 1);
	} else {
	    if (playerX >= ((X_BOUND + 1) / 2) - 2 * DOOR_WIDTH && playerX <= ((X_BOUND + 1) / 2) + 2 * DOOR_WIDTH) {
		double tempPlayerX = playerX;
		
		updateRoom();
		curRoom[1] += 1;

		// reinitialize the room
		resetRoom();
		playerY = (2 * PLAYER_WIDTH);
		playerX = tempPlayerX;
	    } else {
		playerY = Y_BOUND - (2 * WALL_WIDTH) - (2 * PLAYER_WIDTH - 1);
	    }
	}
    }
}

void update_player_bullets() {
    if (frameCounter_player == PLAYER_FIRE_RATE) {
	// Fire bullet in aiming direction
	if (player_aim_h != 0) {
	    float deltaX = (playerX + 5 * player_aim_h) - playerX;  // deltaX is between some point (5 pixels) in the aiming direction and the player
	    float deltaY = 0;
	    float hyp = squareRoot(pow(deltaX, 2) + pow(deltaY, 2), 0.0001);
	    playerBullets[player_curBullet].x = playerX + PLAYER_WIDTH;
	    playerBullets[player_curBullet].y = playerY + PLAYER_WIDTH;
	    playerBullets[player_curBullet].velo_x = PLAYER_BULLET_VELO * (deltaX / hyp);
	    playerBullets[player_curBullet].velo_y = PLAYER_BULLET_VELO * (deltaY / hyp);
	    playerBullets[player_curBullet].isActive = 1;

	    player_curBullet = player_curBullet + 1;

	    if (player_curBullet >= NUM_BULLETS) player_curBullet = 0;
	} else if (player_aim_v != 0) {
	    float deltaX = 0;
	    float deltaY = (playerY + 5 * player_aim_v) - playerY;
	    float hyp = squareRoot(pow(deltaX, 2) + pow(deltaY, 2), 0.0001);
	    playerBullets[player_curBullet].x = playerX + PLAYER_WIDTH;	 // create bullet at player location to fire
	    playerBullets[player_curBullet].y = playerY + PLAYER_WIDTH;
	    playerBullets[player_curBullet].velo_x = PLAYER_BULLET_VELO * (deltaX / hyp);
	    playerBullets[player_curBullet].velo_y = PLAYER_BULLET_VELO * (deltaY / hyp);
	    playerBullets[player_curBullet].isActive = 1;

	    player_curBullet = player_curBullet + 1;

	    if (player_curBullet >= NUM_BULLETS) player_curBullet = 0;
	}

	frameCounter_player = 0;
    } else {
	frameCounter_player = frameCounter_player + 1;
    }

    for (int i = 0; i < NUM_BULLETS; i++) {
	if (playerBullets[i].isActive) {
	    // update movement
	    // check if offscreen
	    playerBullets[i].x = playerBullets[i].x + playerBullets[i].velo_x;
	    playerBullets[i].y = playerBullets[i].y + playerBullets[i].velo_y;

	    if (playerBullets[i].x >= X_BOUND || playerBullets[i].x <= 0 || playerBullets[i].y >= Y_BOUND || playerBullets[i].y <= 0) {
		player_reset_bullet(i);
	    }

	    for (int j = 0; j < NUM_ENEMIES; j++) {
		// Detect if player bullet hit enemy
		if(rooms[curRoom[0]][curRoom[1]].isBoss){
			if (enemies[j].isActive) {
		    if (playerBullets[i].x + (2 * PLAYER_BULLET_WIDTH) >= enemies[j].x && playerBullets[i].x < enemies[j].x + (4 * ENEMY_WIDTH)) {
			if (playerBullets[i].y + (2 * PLAYER_BULLET_WIDTH) >= enemies[j].y && playerBullets[i].y < enemies[j].y + (4 * ENEMY_WIDTH)) {
			    enemies[j].health--;
				
				if (enemies[j].health == 0) {
					enemies[j].isActive = 0;	    // Deactivate enemy
					numActiveEnemies--;		    // Reduce enemy count
				}
			    playerBullets[i].isActive = 0;  // deactivate bullet, don't make bullet shoot through enemy
			}
		    }
		}
		}

		if (enemies[j].isActive) {
		    if (playerBullets[i].x + (2 * PLAYER_BULLET_WIDTH) >= enemies[j].x && playerBullets[i].x < enemies[j].x + (2 * ENEMY_WIDTH)) {
			if (playerBullets[i].y + (2 * PLAYER_BULLET_WIDTH) >= enemies[j].y && playerBullets[i].y < enemies[j].y + (2 * ENEMY_WIDTH)) {
			    enemies[j].health--;
				
				if (enemies[j].health == 0) {
					enemies[j].isActive = 0;	    // Deactivate enemy
					numActiveEnemies--;		    // Reduce enemy count
				}
			    playerBullets[i].isActive = 0;  // deactivate bullet, don't make bullet shoot through enemy
			}
		    }
		}
	    }
	}
    }
}

// later: add a desync between enemies firing, don't make them all fire at the same time

void update_bullet() {
    
	if (rooms[curRoom[0]][curRoom[1]].isBoss) {
		if (frameCounter_enemy == FIRE_RATE / 5) {
					for (int i = 0; i < NUM_ENEMIES; i++) {
				if (enemies[i].isActive) {
				// fire bullet - ie. get velocity, set isActive = 1;
				enemyBullets[curBullet].x = enemies[i].x;
				enemyBullets[curBullet].y = enemies[i].y;
				float deltaX = playerX + (PLAYER_WIDTH - 1) - enemies[i].x;  // Aiming at the centre of the player, hence playerWidth - 1 added
				float deltaY = playerY + (PLAYER_WIDTH - 1) - enemies[i].y;
				float hyp = squareRoot(pow(deltaX, 2) + pow(deltaY, 2), 0.0001);
				enemyBullets[curBullet].velo_x = BULLET_VELO * (deltaX / hyp);
				enemyBullets[curBullet].velo_y = BULLET_VELO * (deltaY / hyp);
				enemyBullets[curBullet].isActive = 1;
				curBullet = curBullet + 1;

				if (curBullet >= NUM_BULLETS) curBullet = 0;
				}
			}

			frameCounter_enemy = 0;
		}
		else {
			frameCounter_enemy = frameCounter_enemy + 1;
		}
	}
	else if (frameCounter_enemy == FIRE_RATE) {
	for (int i = 0; i < NUM_ENEMIES; i++) {
	    if (enemies[i].isActive) {
		// fire bullet - ie. get velocity, set isActive = 1;
		enemyBullets[curBullet].x = enemies[i].x;
		enemyBullets[curBullet].y = enemies[i].y;
		float deltaX = playerX + (PLAYER_WIDTH - 1) - enemies[i].x;  // Aiming at the centre of the player, hence playerWidth - 1 added
		float deltaY = playerY + (PLAYER_WIDTH - 1) - enemies[i].y;
		float hyp = squareRoot(pow(deltaX, 2) + pow(deltaY, 2), 0.0001);
		enemyBullets[curBullet].velo_x = BULLET_VELO * (deltaX / hyp);
		enemyBullets[curBullet].velo_y = BULLET_VELO * (deltaY / hyp);
		enemyBullets[curBullet].isActive = 1;
		curBullet = curBullet + 1;

		if (curBullet >= NUM_BULLETS) curBullet = 0;
	    }
	}

	frameCounter_enemy = 0;
    } else {
	frameCounter_enemy = frameCounter_enemy + 1;
    }
    // later: will need to use a for loop for each
    // change enemyBullets.x in deltas to enemy locations

    for (int i = 0; i < NUM_BULLETS; i++) {
	if (enemyBullets[i].isActive) {
	    // update movement
	    // check if offscreen
	    enemyBullets[i].x = enemyBullets[i].x + enemyBullets[i].velo_x;
	    enemyBullets[i].y = enemyBullets[i].y + enemyBullets[i].velo_y;

	    // bullet went offscreen
	    if (enemyBullets[i].x >= X_BOUND || enemyBullets[i].x <= 0 || enemyBullets[i].y >= Y_BOUND || enemyBullets[i].y <= 0) {
		reset_bullet(i);
	    }

	    // Collision detection
	    if (enemyBullets[i].x >= playerX && enemyBullets[i].x < playerX + (2 * PLAYER_WIDTH)) {
		if (enemyBullets[i].y >= playerY && enemyBullets[i].y < playerY + (2 * PLAYER_WIDTH)) {
		    // Collision detected
		    isPlayerHit = 1;
			
			enemyBullets[i].isActive = 0;
			
			playerHealth--;
			
			if (playerHealth == 0) {
				init_globals();
				gameState = STATE_GAMEOVER;
			}
		}
	    }
	}
    }
}

void update() {
	
	
    /*
	read a key input - done, handle_input

	update player position
	run player checks
	    collision with walls, terrain, exits, bullets

	later:
	    update bullet position
	    check bullet collision
	    update enemy health and whatever

	    change update depending on game state
    */
	updateLED();
	updateRoom();

    if (gameState == STATE_PLAYING) {

    updateDoors();
	}

    handle_input();  // later: have a separate input handler for menus
    if (gameState == STATE_PLAYING) {
		update_player();

		update_bullet();
		update_player_bullets();
	}
}

