double squareRoot(double n, float l) {
    // Assuming the sqrt of n as n only
    double x = n;

    // The closed guess will be stored in the root
    double root;

    // To count the number of iterations
    int count = 0;

    while (1) {
	count++;

	// Calculate more closed x
	root = 0.5 * (x + (n / x));

	// Check for closeness
	if (abs(root - x) < l)
	    break;

	// Update root
	x = root;
    }

    return root;
}

// Function to check if a position is valid
int isValidPosition(int x, int y) {
    return x >= 0 && x < MAP_SIZE && y >= 0 && y < MAP_SIZE;
}

// Function to check if a room is connected to at least one other room
int isConnected(int x, int y, int map[MAP_SIZE][MAP_SIZE]) {
    int connections = 0;
    int allowedConnections = (rand() % 2) + 1;	// sometimes 1, sometimes 2, adds some variety

    if (isValidPosition(x, y)) {
	if (map[x][y] == 1)
	    return 0;  // Already a room
	if (isValidPosition(x - 1, y) && map[x - 1][y] == 1)
	    connections += 1;
	if (isValidPosition(x + 1, y) && map[x + 1][y] == 1)
	    connections += 1;
	if (isValidPosition(x, y - 1) && map[x][y - 1] == 1)
	    connections += 1;
	if (isValidPosition(x, y + 1) && map[x][y + 1] == 1)
	    connections += 1;
    }

    if (connections >= 1 && connections <= allowedConnections) {
	return 1;
    }

    return 0;
}

// Function to generate a random room position
void generateRandomPosition(int *x, int *y) {
    int centerX = MAP_SIZE / 2;
    int centerY = MAP_SIZE / 2;
    int distX = rand() % (MAP_SIZE / 2);
    int distY = rand() % (MAP_SIZE / 2);
    if (rand() % 2)
	distX = -1;
    if (rand() % 2)
	distY = -1;
    *x = centerX + distX;
    *y = centerY + distY;
}

// Function to generate a map of rooms
void generateMap(int map[MAP_SIZE][MAP_SIZE]) {

    // Initialize the map with zeros
    for (int i = 0; i < MAP_SIZE; i++) {
	for (int j = 0; j < MAP_SIZE; j++) {
	    map[i][j] = 0;
	}
    }

    // Place a room at the center
    map[MAP_SIZE / 2][MAP_SIZE / 2] = 1;

    // Generate additional rooms until the maximum number is reached
    int roomCount = 1;
    while (roomCount < MAX_ROOMS) {
	// Generate a random room anywhere on the map
	int randX, randY;
	generateRandomPosition(&randX, &randY);
	// Check if the room is connected to at least one other room and not already a room
	if (!isConnected(randX, randY, map)) {
	    continue;
	}

	if (roomCount < MAX_ROOMS - 1) {
	    map[randX][randY] = 1;
	} else {
	    map[randX][randY] = 2;
	}

	roomCount++;
    }
}
